%flink
case class WordCount(word: String, frequency: Int)
val bible:DataSet[String] = env.readTextFile("/Volumes/ramdisk/WordCount/10.txt.utf-8")
val partialCounts: DataSet[WordCount] = bible.flatMap{
    line =>
        """\b\w+\b""".r.findAllIn(line).map(word => WordCount(word, 1))
//        line.split(" ").map(word => WordCount(word, 1))
}
val wordCounts = partialCounts.groupBy("word").reduce{
    (left, right) => WordCount(left.word, left.frequency + right.frequency)
}

val result10 = wordCounts.first(10).collect()

%flink
import org.apache.flink.util._
import scala.collection.mutable.PriorityQueue

def getNMostFrequentWords(words: DataSet[WordCount], numberOfWords: Int): DataSet[WordCount] = {
     words.reduceGroup{
    (elements, coll: Collector[WordCount]) =>
        implicit val ordering = new Ordering[WordCount]{
            override def compare(left: WordCount, right: WordCount): Int = right.frequency - left.frequency
        }
        val queue = new PriorityQueue[WordCount]()

        while(elements.hasNext) {
            val element = elements.next()
            queue.enqueue(element)

            if(queue.size > numberOfWords) {
                queue.dequeue
            }
        }
        queue.foreach(coll.collect(_))
    }
}
